To make an string array WITHOUT having a set number of variables:
List<String> (name of variable) = new ArrayList<>();
Important Commands:
(variable name).add(String);
(variable name).remove(string);
(variable name).get(integer);
The idea is to have 2 seperate lists with the questions and the answers. There MUST be the same number of questions to answers in order for the index to work. When you create this list, everything in it will be indexed starting from 0. Make a random number generator to get this to pick random questions.

